import React from 'react'
import '../css/Recipe.css'
const Recipe = ({recipe}) => {
    const recipeImg = `https://spoonacular.com/recipeImages/{recipe.id}-{312x150}.{jpg}`
    return (
        <div className="recipe">
            <img src={recipeImg} alt='' />
            <h3>{recipe.title}</h3>
        </div>
    )
}

export default Recipe
